import React from "react";
import {
  Box,
  Button,
  Checkbox,
  FormControl,
  FormControlLabel,
  FormGroup,
  FormLabel,
  Grid,
  TextField,
} from "@material-ui/core";
import FormikControl from "../../../hooks/FormikControl";
import Question from "../../../../../images/Question.png";
import { useStyles } from "./styles";

function OfferCheckbox({ formik, TypeLenseigne ,TypeOffre,typeInscrire}) {
  const classes = useStyles();

  return (
    <Box className={classes.Container}>
      <Box>
        <FormikControl
          control="checkbox"
          label="Type de l'enseigne"
          name="TypeLenseigne"
          options={TypeLenseigne}
          field={formik.values}
        />
      </Box>

      <Box>
        <FormikControl
          control="checkbox"
          label="Type de l'enseigne"
          name="offre"
          options={TypeOffre}
          field={formik.values}
        />

        <FormControl style={{ width: "15vw", marginTop: 10 }}>
          <Box style={{ display: "flex", alignItems: "center" }}>
            <FormLabel
              component="legend"
              style={{ fontWeight: "800", color: "#000" }}
            >
              Label SMR
            </FormLabel>
            <img src={Question} style={{ width: 35, height: 30 }} />
          </Box>


          <FormikControl
          control="checkbox"
          label=""
          name="inscrire"
          options={typeInscrire}
          field={formik.values}
        />
          {/* <FormControlLabel
            style={{ marginTop: 10 }}
            control={
              <Checkbox
                name="souscrire"
                color="default"
              />
            }
            label="Je souhaite souscrire au label Sain,Main,Responsable"
          /> */}
        </FormControl>
      </Box>
    </Box>
  );
}

export default OfferCheckbox;
